import React from 'react';
import { PostInfoStyled } from './Postinfo.style';

const PostInfo = ({
  title,
  description,
  imageUrl,
  content
}) => {
  return (
    <PostInfoStyled>
      <image src={imageUrl} alt={title} />
      <h3>Titre: {title}</h3>
      <div>Description: {description}</div>
      <div>Contenu: {content}</div>
    </PostInfoStyled>
  );
};

export { PostInfo };
